import Link from "next/link";

const linkStyle = {
  marginRight: "10px"
};

export function Header() {
  return (
    <div>
      <Link href="/about">
        <a style={linkStyle}>Go To About</a>
      </Link>
      <Link href="/blog">
        <a style={linkStyle}>Go To Blog</a>
      </Link>
    </div>
  );
}
